import Layout from '../comps/MyLayout';
import Link from 'next/link';

export default function Index() {
  return (
    <Layout>
    <div>
      <p>Hello Next.js</p>
      <Link href="/about.js" />
    </div>
    <style jsx>{`
        h1,
        a {
          font-family: 'Arial';
        }

        ul {
          padding: 0;
        }

        li {
          list-style: none;
          margin: 5px 0;
        }

        a {
          text-decoration: none;
          color: blue;
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>
    </Layout>
  );
}
